import React from 'react';
import styled from "styled-components";
import {FlexWrapper} from "../../components/FlexWrapper";
import {Logo} from "../../components/logo/Logo";

export const Footer = () => {
    return (
        <StyledFooter>
            <FlexWrapper>
                <div>
                    <Logo/>
                </div>
                <div>
                    <FlexWrapper>

                    </FlexWrapper>
                </div>
            </FlexWrapper>
        </StyledFooter>
    );
};

const StyledFooter = styled.footer`
  min-height: 50vh;
  background-color: #000000;
`
